import React from "react";
import DataTable from "react-data-table-component";

function Table() {
  const data = [
    {
      name: "John",
      startTime: "09:00",
      endTime: "12:00",
      hoursWorked: "3:00",
      ratePerHour: "$10.00",
    },
    {
      name: "Alice",
      startTime: "10:00",
      endTime: "14:00",
      hoursWorked: "4:00",
      ratePerHour: "$12.00",
    },
  ];

  const column = [
    {
      name: <h1>S.No</h1>,
      width: "60px",
      cell: (row, index) => <div className="text-[#6D6D6D]">{index + 1}</div>,
    },
    {
      name: <h1>Name</h1>,
      width: "auto",
      cell: (row, index) => <div className="text-[#6D6D6D]">Ganesh</div>,
    },
    {
      name: <h1>Start Time</h1>,
      width: "auto",
      cell: (row, index) => <div className="text-[#6D6D6D]">12:00</div>,
    },
    {
      name: <h1>End Time</h1>,
      width: "auto",
      cell: (row, index) => <div className="text-[#6D6D6D]">02:00</div>,
    },
    {
      name: <h1>No of hours worked</h1>,
      width: "auto",
      cell: (row, index) => <div className="text-[#6D6D6D]">02:00</div>,
    },
    {
      name: <h1>Rate per hour</h1>,
      width: "auto",
      cell: (row, index) => <div className="text-[#6D6D6D]">02:00</div>,
    },
  ];
  return (
    <div className="bg-red-500 w-[90%] w-[10em]">
      <DataTable
        // key={column}
        columns={column}
        data={data}
        // customStyles={tableCustomStyles}
        highlightOnHover
        pagination
      ></DataTable>
    </div>
  );
}

export default Table;

